import Link from 'next/link';

const Header = () => (
  <div>
  	<img src="#"></img>
  	<nav>
  		<ul>
  			<li>
			    <Link href="/">
			    	<a>Find a Pup</a>
			    </Link>
		    </li>
		    <li>
			    <Link href="/about">
			    	<a>About</a>
			    </Link>
		    </li>
    	</ul>
    </nav>
     <style jsx>{`
        div {
        	background-color: #4ABDAC;
        }

        h1,
        a {
          font-family: 'Arial';
        }

        ul {
          padding: 0;
        }

        li {
          list-style: none;
          margin: 5px 0;
        }

        a {
          text-decoration: none;
          color: blue;
        }

        a:hover {
          opacity: 0.6;
        }
      `}</style>
  </div>

);

export default Header;
